import React from 'react';

const PlayerGrid = ({players}) => (
  <div className="wrap">
  <ul>
    {players.map(player => (
      <li>
        <img src={player.strThumb}/>
        {player.strTeam}
        {player.strNationality}
      </li>))}
  </ul>
  </div>
);

export default PlayerGrid;
